import { useState } from 'react';
import { dermadect_vite_backend } from 'declarations/dermadect-vite-backend';

function App() {
  const [greeting, setGreeting] = useState('');

  function handleSubmit(event) {
    event.preventDefault();
    const name = event.target.elements.name.value;
    dermadect_vite_backend.greet(name).then((greeting) => {
      setGreeting(greeting);
    });
    let base64image = `data:image/webp;base64,`;
    // console.log(base64image);
    dermadect_vite_backend.predictImage(base64image).then((response) => {
      console.log(response);
    });
    return false;
  }

  return (
    <main>
      <img src="/logo2.svg" alt="DFINITY logo" />
      <br />
      <br />
      <form action="#" onSubmit={handleSubmit}>
        <label htmlFor="name">Enter your name: &nbsp;</label>
        <input id="name" alt="Name" type="text" />
        <button type="submit">Click Me!</button>
      </form>
      <section id="greeting">{greeting}</section>
    </main>
  );
}

export default App;
